	},
	{
		id: 1245645623,
		images: ['/movies/matrix.jpg'],
		title: 'Harry Potter',
		Price: 15.99,
		sale: 14.99,
	},
	{
		id: 1123123132,
		images: ['/movies/harry_potter.jpg'],
		title: 'Harry Potter',
		Price: 15.99,
		sale: 14.99,
	},
];
class MovieList extends Component {
	render() {
		return (
			<Container>
				<Movies movies={MOVIES} moviesPerLine={4} />
			</Container>
		);
	}
}

export default MovieList;
